def compile(code):
    """"""
    operations = code.split(' ')
    current_operation = ''
    sum = 0
    for operation in operations:
        if operation == 'ADD' or operation == 'SUB':
            current_operation = operation
        elif current_operation == 'ADD':
            sum += int(operation)
        elif current_operation == 'SUB':
            sum -= int(operation)
        else:
            sum = int(operation)
    return sum
